Вопрос 2: Перечислите принципиальные признаки КФС

Источники: Тема 1.doc, Лекция 1
Основные признаки:

Гетерогенность - физическая разнородность устройств и элементов системы;
Неоднородность описания и задания исходных данных (определяемая зашумленностью измеряемых параметров, неопределенностью обстановки окружающей среды);
Многомерность или многосвязность - система многомерна, если число её фазовых координат больше 3;
Многокритериальность при решении задач проектирования и производства;
Мультиагентность
Информационное обеспечение таких систем включает глобальные сети, осуществляющие связь между отдельными источниками информации, механизмы сжатия информации.

tickets/3.html.body:
Вопрос 3:    Покажите принадлежность к КФС: Система управления «Природа-Техногеника», Система управления «Город», Околоземная космическая станция, Навигационный прибор

Источники: Тема 1.doc, Лекция 1
Система управления «Природа-Техногеника» (СУПТ)
СУПТ является типичной КФС, поскольку содержит все принципиальные характеристики таких систем.

Гетерогенность подсистем (физико-химические, информационно-измерительные, механические, гидравлические и др.);
Многокритериальность при проектировании и производстве;
Неопределённость в процессе создания СУПТ, например, при задании исходных данных (природные явления, техногенные «отказы» и т.д);
Мультигентность, выражающаяся в подсистемах информационно-измерительной (ИИ), подвижных носителей ИИ, исполнительных в сочетании с регуляторами.

Система управления «Город»

Город как КФС включает такие важнейшие подсистемы, как строительство, транспорт, теплоэнергетическая и водопроводно-канализационная, связь, промышленные предприятия, торговля, здравоохранение, культурные предприятия;
Многочисленные проблемы, возникающие в системе «город» известные как общая проблема урбанизации, настоятельно требуют подходы к ее как КФС;
Городское хозяйство гетерогенно;
Отдельные подсистемы КФС «город» физически разнородны, содержат много неопределенных факторов, обладают множеством экономических, социологических, технических связей.
Охрана окружающей среды, в котором множество неопределенностей

Околоземная космическая станция (ОКС)
При создании и эксплуатации такой системы неизбежно вступают в противоречия требования: 

высокой точности стабилизации и ориентации и минимизации веса;
габаритов, энергоресурсов ОКС, высокой надежности и длительности работы при минимуме расхода топлива, аппаратных средств и т.д. 
Таким образом, в этом примере имеет место физическая разнородность подсистем, многоцелевой характер ОКС, многомерность и многосвязность систем управления ОКС.

Навигационный прибор
Содержит все признаки КФС: 

гетерогеность (механичесие, электронные, оптические пневматические составляющие);
многокритериальность при проектировании и производстве (точность, вес, габариты и т.д); 
неопределённость по исходным данным и др.

tickets/12.html.body:
Вопрос 12: 2.    Индустрия 4.0 – революция или дальнейшее развитие информационных технологий?

Источники: Тема 2.doc
Появившиеся в последнее время понятие «индустрия 4.0» представляет собой эволюционное развитие информационных технологией (ИТ) и применение ИТ от ТЗ до выпуска готового изделия. 
Соответствующая концепция была предложена К. Швабом как средство повышения конкурентоспособности промышленности Германи путём внедрения киберфизических систем в процессы производства.
Развитие науки и техники и соответственно производительных сил обеспечивают в настоящее время реализацию «машинно-ориентированных» идей, методов и алгоритмов, которые были созданы в 70 - 80-х годы прошлого века. В настоящее время эти базовые методы и алгоритмы могут быть реализованы, что приводит к новому всплеску «машинной революции» 70 - 80-х г.г., - повторению полной замены человека системами АСНИ, САПР, АСТПП, ГПС, АСУ и т.п. 
Разница в множестве «кибернетических публикаций» того времени и аналогичных в настоящее время часто сводится лишь к замене терминов «автоматизация», «интеграция», «сквозная автоматизация» и т.п. на новые термины - «цифровизация», «Индустрия 4.0», «интернет вещей» и т.п.
По существу, дело сводится к прогрессу орудий труда как самой подвижной составляющей производительных сил. 
Действительно, орудия труда – инструментарий исследователя, проектировщика, производственника, - с прогрессом инфраструктуры информационных технологий (IT) изменились существенно, что сделало доступным массовое применение интернета, глобальных и локальных сетей технологий больших данных (Big Data) для решения проектных и производственных задач. 
Программа «Индустрия-4.0» включает в себя реализацию следующих направлений:

промышленный Интернет вещей (датчики и оборудование на производстве объединены в одну сеть иерархической структурой и подчинены единой системе управления производством);
дополненная реальность (применима для различных целей, в т.ч. при выборе частей различных конструкций на складе, отображении инструкций по ремонту и обслуживанию оборудования и т.д.);
большие данные (BIG DATA) и бизнес аналитика (аналитика, основанная на работе с большим объемом данных, что позволяет оптимизировать качество продукции, экономить энергию и повысить работоспособность оборудования);
«облачные технологии» (применяются ведущими компаниями при решении многих задач, в частности, в программном обеспечении своей производственной деятельности и т.д.). Необходимость обработки больших баз данных требует дальнейшего совершенствования «облачных сервисов »;
автономные роботы (т.е. гибкие и функционально независимые);
горизонтальная и вертикальная интеграция систем (организация тесного взаимодействия как на различных уровнях внутри предприятия, так и между предприятиями- партнерами по производственному циклу);
информационная безопасность (защищенный доступ, надежная связь, полный контроль доступа к сетям управления);
аддитивное производство (освоение в промышленности аддитивных технологий, в т.ч. применение 3D-печати для прототипирования и производства отдельных деталей);
цифровое моделирование, являющееся одним из базовых направлений реализации программы «Индустрия-4.0», которое будет активно применяться в производственных процессах, в том числе путем использования актуальных данных, получаемых с помощью виртуальной модели окружающего физического мира.

tickets/14.html.body:
Вопрос 14: Каков порядок подготовки предприятия к внедрению ИТ?

Эффективность системного анализа процесса проектирования в целях внедрения САПР в значительной степени зависит от организации работ по его обследованию. Для проведения работ на данном этапе формируется рабочая группа, которая руководствуется приказом руководителя предприятия, в котором должны быть определены: 

состав обследуемых подразделений, занятых проектированием конкретных изделий;

состав исполнителей, участвующих в обследовании;

обязанности, выполняемые каждым подразделением и исполнителем, проводящим обследование;

сроки проведения обследования и порядок представления результатов работы.


Обследование выполняется специалистами подразделений предприятия, в число которых включаются:

разработчики САПР;

опытные специалисты по соответствующему направлению техники.


При анализе автоматизации процесса проектирования определяют: количественные и качественные характеристики управляемой и управляющей подсистем, целесообразность внедрения ИТ и степень подготовленности соответствующей подсистемы для ее дальнейшего совершенствования.
Системный анализ процесса проектирования с целью внедрения ИТ удобно разделить на внешний и внутренний:

основные задачи внешнего анализа процесса проектирования следующие: определение ее организационной структуры и перечня проектных процедур, выполняемых в ней; выявление связей между управляющей и управляемой подсистемами; построение или корректировка модели управляемой подсистемы;

на этапе внутреннего анализа процесса проектирования решаются задачи построения моделей конкретных проектных процедур, выделенных в качестве типовых; определение их технико-экономических характеристик с учетом всей входной и выходной документации, а также технологии проектирования и испытаний.


Ниже представлена очень подробная информация об этапах внешнего и внутреннего анализа.

Этапы внешнего анализа:
1 ШАГ

раскрытие организационной структуры подразделений предприятия, занятых разработкой схем, конструкторским и технологическим проектированием, а также испытаниями опытных образцов;

выявление технико-экономической информации об имеющихся на предприятии технических средствах, программно-методических комплексах и пакетах прикладных программ.


При этом прослеживаются пути прохождения информации от подразделения к подразделению, а также производится анализ этих путей для получения ответов на следующие вопросы:

какие данные передаются по линиям связи локальной вычислительной сети, а какие с помощью документов на бумажных и машинных носителях;

каковы фактические сроки передачи данных;

какая информация не находит своих получателей в других подразделениях предприятия.


Информационный анализ целесообразно разбить на следующие операции:

составление перечня проектируемых изделий в целом и их составных частей;

составление перечня проектных процедур (операций);

составление полного перечня входной и выходной информации;

классификация информации;

выявление избыточной информации и дублирующих связей и циклов.


Техническую документацию классифицируют по следующим видам:

входная документация;

выходная документация;

документация, вырабатываемая в результате выполнения проектных процедур;

внутренняя документация, используемая исключительно внутри подразделений предприятия.


Результаты анализа удобно заносить в специальные формы, которые затем могут быть закодированы и храниться в памяти ЭВМ.
В результате выполнения первого шага внешнего анализа получают структурную схему управляемой подсистемы с привязкой к конкретным подразделениям предприятия.
2 ШАГ

рассматриваются проектные процедуры, выполняемые в подразделениях предприятия;

определяются типы проектных процедур и их количество по типам.


Классификация проектных процедур производится по признакам:

сходства характера исходных данных и результатов, получаемых при выполнении различных проектных процедур;

сходства категорий проектировщиков: разработчиков, конструкторов, технологов и испытателей.


Для составления перечня типовых проектных процедур анализируется проектная документация, входящая в проект. При этом учитываются такие технико-экономические характеристики, как:
– временные и финансовые затраты;
– объемы и виды информации, переработанной в процессе выполнения проектной процедуры.
На данном этапе обследования не требуется знать характеристики проектных процедур с точностью большей, чем это необходимо для их качественного предварительного сравнения по вкладу в процесс проектирования.
3 ШАГ
Построение информационной модели системы проектирования, которая, по существу, представляет собой интегральное отображение результатов, полученных на предыдущих шагах.
На данном шаге целесообразно использовать итеративный процесс последовательного приближения. Каждая итерация такого процесса связана с получением информации об объекте и процессе проектирования при различной степени их дифференциации, например:

на первой итерации может быть получена информация об объекте в целом без его расчленения;

на второй итерации – о структурной схеме объекта; на третьей – о связях составных частей объекта и т. д.


Информационная модель также является основой для создания модели предметной области для обследуемого процесса проектирования.

Этапы внутреннего анализа 
На этом этапе уточняется и детализируется информация о процессе проектирования, полученная на этапе внешнего анализа.
1 ШАГ 
Выделение из каждой группы:

проектных процедур, полученных в результате классификации на этапе внешнего анализа;

типовых проектных процедур, называемых проектными процедурами-представителями.


Выбор таких процедур осуществляется, как правило, экспертным путем.
2 ШАГ
Для всех процедур-представителей определяются:

количественные оценки;

временные оценки.


Такие оценки осуществляются либо экспертным путем, либо методом хронометражных наблюдений (при этом последний позволяет получить более точные данные о проектных процедурах по сравнению с методом экспертных оценок).
На этом этапе также уточняются структура и объем информации, используемой в процессе проектирования, в том числе и нормативно-справочной документации. Эти сведения впоследствии используются при разработке баз данных ИТ (САПР, АСТПП).
Вся информация, полученная в результате внутреннего анализа, заносится в специальные формы, которые затем кодируются и хранятся в памяти ЭВМ.
Таким образом, внутренний анализ завершается получением интегральных характеристик по трудоемкости, длительности и ряду других параметров выполнения типовых проектных процедур-представителей. На основе внешнего и внутреннего анализа оценивается стратегия внедрения САПР. При этом выявляют:

объекты автоматизации (проектные процедуры);

состояние технических средств автоматизации проектных процедур;

уровень автоматизации проектных процедур;

уровень унификации и стандартизации конструкторско-технологических решений.



В части составляющей ИТ – САПР по результатам дается принципиальная оценка необходимости разработки новой САПР либо совершенствования существующих инструментов САПР. При этом необходимо оценить уровень подготовленности предприятия по следующим показателям:

обеспеченность специалистами, имеющими опыт работы с инструментами САПР;

наличие необходимых технических средств САПР;

возможность финансирования работ по САПР;

соответствие организационной структуры предприятия условиям применения САПР.


На рисунке представлена схема организации выполнения системного анализа процесса проектирования.

tickets/15.html.body:
Вопрос 15: Назовите основные позиции методики обследования проектно-производственного предприятия?

Обследование предприятия является первым этапом при интеграции САПР. Целью обследования является поиск ответов на следующие вопросы:

Какие проектные и производственные процедуры подлежат автоматизации, а какие недоступны для этого.

Каким образом эффективно организовать внедрение.
Также обследование предполагает сравнение текущего состояния предприятия и предполагаемого состояния после внедрения, которое подразумевает некие расчеты, конструктивные решения, расчет экономического эффекта и т.п.


При проведении обследования процесса проектирования для получения данных можно использовать следующую методику:

изучение документов (состоит в том, что необходимая информация выбирается из различных документов, отражающих деятельность проектных подразделений);

анкетирование (в этом случае необходимые данные получают путем заполнения специалистами соответствующих форм (анкет));

устный опрос (состоит в получении данных путем проведения бесед с проектировщиками).


При проведении предпроектных исследований, как и на всех последующих стадиях внедрения САПР, большое значение имеют планирование и управление. В частности, деятельность рабочей группы при обследовании организуется в следующем порядке:
1)    подготовка и выпуск приказа по предприятию;
2)    разработка, согласование и утверждение плана-графика обследования;
3)    сбор данных, проведение опроса;
4)    анализ результатов обследования;
5)    моделирование процесса проектирования, в том числе с внедренной САПР;
6)    подготовка научно-технического отчета.
